    <meta charset="utf-8">
    <style type="text/css">
        .center {
            max-width: 100%;
            max-height: 100%;
            display: block;
            margin: auto auto;
            vertical-align: middle;
        }

        html, body {
            overflow: hidden;
            width   : 100%;
            height  : 100%;
            margin  : 0;
            padding : 0;
			position: fixed;
            display: flex;
        }
        .parent {
            margin: auto;
            background-color: #000;
            display: flex;
            height: 100%;
            width: 100%;
        }
        .centered {
            position: absolute;
            top: 50%;
            left: 50%;
            width   : 80%;
            height  : 80%;
            transform: translate(-50%, -50%);
            z-index: 100;
        }
		video{
			position:absolute; 
			padding: 0;
			margin: 0;
			width: 100%;
			height: 100%;
			object-fit: cover;
			z-index: 10;

			display:none;
		}
		canvas {
            top: 50%;
			left: 50%;
			-webkit-transform: translate(-50%, -50%);
			position:absolute; 
			z-index: 111;
		}
		#icon {
            top: 10px;
			left: 10px;
			-webkit-transform: scale(0.4);
			transform: scale(0.4);
			transform-origin: left top;
			backface-visibility: hidden;
			position:absolute; 
			z-index: 500;
		}
		#scope{    
			left: 50%;
			top: 50%;
			-webkit-transform: translate(-50%, -50%);
			animation-name: scope-anim-reverse;
			animation-duration: 7s;
			animation-iteration-count: infinite;
			animation-timing-function: linear;
			z-index: 112;
		}
		@keyframes scope-anim-reverse {
			0%   {transform:translate(0%,50%);}
			20%   {transform:translate(180%,120%);}
			40%   {transform:translate(-50%,150%);}
			60%   {transform:translate(180%,120%);}
			80%   {transform:translate(130%,150%);}
			100%   { transform:translate(0%,50%);}
		}
		 .btn {
			position: absolute;
			width:200px;
			z-index:200;
			padding: 0.7em 2.1em 0.8em;
			border-radius: 10px;
			margin: 8px 8px 8px 8px;
			animation-name: btn-anim-reverse;
			animation-duration: 0.5s;
			animation-iteration-count: infinite;
			animation-timing-function: linear;
			left: 50%;
			top: 90%;
			-webkit-transform: translate(-50%, -50%);
			color: #fbdedb;
			font-family: sans-serif;
			font-weight: 800;
			font-size: 1.2em;
			text-transform: uppercase;
			text-align: center;
			text-decoration: none;
			-webkit-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			-moz-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			
		}
		@keyframes btn-anim-reverse {
			0% {
				-webkit-transform: translate(-50%, -50%);
			}
			50% {
				-webkit-transform: translate(-50%, -60%);
			}
			100% {
				-webkit-transform: translate(-50%, -50%);
			}
		}
		.btn:hover, .btn:focus {
			opacity: 0.8;
		}
		.btn:active {
			-webkit-transform: scale(0.80);
			-moz-transform: scale(0.80);
			-ms-transform: scale(0.80);
			-o-transform: scale(0.80);
			transform: scale(0.80);
		}
		.btn.block {
			display: block !important;
		}

		.red {
			background-color: #d55050;
		}
		.disable-select {
			user-select: none; /* supported by Chrome and Opera */
		   -webkit-user-select: none; /* Safari */
		   -khtml-user-select: none; /* Konqueror HTML */
		   -moz-user-select: none; /* Firefox */
		   -ms-user-select: none; /* Internet Explorer/Edge */
		}
    </style>


<script charset="utf-8">
	var state = 0;
	var installNow = false;

	var currOrient = "";
	window.oncontextmenu = function(event) {
		 event.preventDefault();
		 event.stopPropagation();
		 return false;
	};
	window.onresize = function(event) {
		handleSize();
	};
	var currOrient = "";
	
	function handleSize(){
		var vid = document.getElementById('gifimage');
		var vidSource = document.getElementById('vidsource');
		var canvasSource = document.getElementById('gameCanvas');
	
		
	}
	function resetCSS(){
		var vid = document.getElementById('gifimage');
		var vidSource = document.getElementById('vidsource');

		vid.style.paddingTop        = 0;
		vid.style.paddingBottom     = 0;
		vid.style.paddingLeft       = 0;
		vid.style.paddingRight      = 0;
		vid.style.height            = "100%";
		vid.style.width             = "100%";
	}
</script>
<script>
	var initTime = new Date().getTime();
	var gameover=0, gameTimeout, missedStart=0, missedTimeout, sparkTimeout;
	
	function clickthrough(event){
		event.preventDefault();
		
		if(state%2!=0)
		{
			//increment state value to enable ad during video on touch. Otherwise keep it like this.
			//state++;
			missedStart=0;
			var newTime = new Date().getTime();
			if(newTime >= initTime+500)
			{
				console.log("state val 2: "+state);
				
				gameover=1;
				if(gameTimeout) clearTimeout(gameTimeout);
				gameTimeout = setTimeout(function(){gameover=0;},500);
				
				missedStart = 1;
				if(missedTimeout) clearTimeout(missedTimeout);
				missedTimeout = setTimeout(function(){missedStart=0;},1500);
				
				initTime = new Date().getTime();
			
				var vid = document.getElementById('gifimage2');
				vid.style.visibility = 'hidden';
				document.getElementById("btn").style.visibility = 'visible';
				//state = 99;
				state++;
			}
		}
		
		
		else if(state%2==0)
		{
			var newTime = new Date().getTime();
			if(newTime >= initTime+500)
			{
				initTime = new Date().getTime();
				console.log("state 00: "+initTime);
				console.log("state val: "+state);
				missedStart=0;
				
				var vid = document.getElementById('gifimage2');
				vid.style.visibility = 'visible';
				document.getElementById("btn").style.visibility = 'hidden';
				state++;
			}
		}
		
		if(state==2)
		{			
			var btn = document.getElementById("btn");
			btn.className = "btn red";
			btn.style.opacity=1;
			btn.style.zIndex = 200;
		}
	}
	
	function btnevent(event){
		if (window.mraid) {
			mraid.open('https://itunes.apple.com/app/id1535441769');
		} else {
			window.location = 'https://itunes.apple.com/app/id1535441769';
		}
	}
</script>

	class Player {
		constructor(){
			this.x = canvas.width/2;
			this.y = canvas.height/2;
			this.radius = 50;
			//this.height = 20;
			this.angle = 0;
			this.frameX = 0;
			this.frameY = 0;
			this.frame = 0;
			this.spriteWidth = 170;
			this.spriteHeight = 170;
			this.imgSrc = dragtoaim;
			this.alpha=1;
		}
		update(){
			if(state!=0)//|| (state==2 && !installNow))
				this.alpha = 0;
			//else if(state==2)// && installNow)
			//{
				//this.imgSrc = installNowSprite;
				//if(globalAlphaToggle)
				//	{if(this.alpha<=1)this.alpha+=0.1;console.log("alpha on toggle true: "+this.alpha);}
				//else 
				//	{if(this.alpha>=0)this.alpha-=0.1;console.log("alpha on toggle false: "+this.alpha);}
				//this.alpha = 1;
			//}
		}
		draw(){
			ctx.restore();
			ctx.save();
			ctx.globalAlpha = this.alpha;
			ctx.translate(canvas.width/2, canvas.height/2+(canvas.height/2.8));
			ctx.drawImage(this.imgSrc, 0, 0, this.imgSrc.width, this.imgSrc.height, 0 - this.imgSrc.width/4, 0 - this.imgSrc.width/4, this.imgSrc.width * 0.5, this.imgSrc.height * 0.5);
			ctx.restore();
		}
	}
	const player = new Player();
	
	class Hand {
		constructor(){
			this.x = canvas.width/2;
			this.y = canvas.height/2;
			this.radius = 1.0;
			//this.height = 20;
			this.angle = 0;
			this.frameX = 0;
			this.frameY = 0;
			this.frame = 0;
			this.spriteWidth = 120;
			this.spriteHeight = 146;
			this.alpha=1;
		}
		update(){
			 if(this.radius<1.2)
				this.radius=this.radius+0.005;
			else this.radius=1;
			
			if(state!=0)
				this.alpha = 0;
		}
		draw(){
			ctx.fillStyle = 'black';
			ctx.save();
			ctx.globalAlpha = this.alpha;
			ctx.translate(this.x, this.y);
			ctx.rotate(-45*Math.PI/180);
			ctx.scale(this.radius*0.5, this.radius*0.5);
			ctx.drawImage(handSprite, 0, 0);
			ctx.restore();
		}
	}
	const hand = new Hand();

			this.radius = 0.6;
			//this.height = 20;
			this.angle = 0;
			this.frameX = 0;
			this.frameY = 0;
			this.frame = 0;
			this.spriteWidth = 170;
			this.spriteHeight = 170;
			this.alpha=0;
			this.sprite= sparkImg;
		}
		update(){
			if(gameover) {
				this.alpha = 1;
				(this.radius<=0)? this.radius = 0: this.radius-=0.07;
			} else {
				this.alpha = 0;
				this.radius = 0.6;
			}
		}
		draw(){
			var scF = (window.innerWidth>window.innerHeight)? (canvas.height-100)/this.sprite.height:(canvas.width-50)/this.sprite.width;
			ctx.save();
			ctx.globalAlpha = this.alpha;
			ctx.translate(this.x, this.y);
			ctx.scale(scF*this.radius, scF*this.radius);
			ctx.drawImage(this.sprite, 0, 0, this.sprite.width, this.sprite.height, 0 - this.sprite.width/4, 0 - this.sprite.width/4, this.sprite.width * 0.5, this.sprite.height * 0.5);
			ctx.restore();
		}
	}
	
	const sparks = new Spark();
	
	var translateMiss=0;
	class Miss {
		constructor(){
			this.x = canvas.width/2;
			this.y = canvas.height/2;
			this.radius = 1;
			//this.height = 20;
			this.angle = 0;
			this.frameX = 0;
			this.frameY = 0;
			this.frame = 0;
			this.spriteWidth = 170;
			this.spriteHeight = 170;
			this.alpha=0;
			this.sprite= missedImg;
		}
		update(){
			if(missedStart) {
				this.alpha = 1;
				translateMiss=0;
			} else {
				if(translateMiss<2000 ) translateMiss+=50;
				//if(window.innerWidth>window.innerHeight) this.alpha=0;
			}
		}
		draw(){
			var scF = 1;//(window.innerWidth>window.innerHeight)? (canvas.height-100)/this.sprite.height:(canvas.width-50)/this.sprite.width;
			this.y = (window.innerWidth>window.innerHeight)? canvas.height/2-20:canvas.height/2-100;
			ctx.save();
			ctx.globalAlpha = this.alpha;
			ctx.translate(this.x+translateMiss, this.y);
			ctx.scale(scF*this.radius, scF*this.radius);
			ctx.drawImage(this.sprite, 0, 0, this.sprite.width, this.sprite.height, 0 - this.sprite.width/4, 0 - this.sprite.width/4, this.sprite.width * 0.5, this.sprite.height * 0.5);
			ctx.restore();
		}
	}
	
	const missed = new Miss();
	
	function animate(){
		ctx.clearRect(0, 0, canvas.width, canvas.height);
		player.update();
		player.draw();
		hand.update();
		hand.draw();
		sparks.update();
		sparks.draw();
		missed.update();
		missed.draw();
		requestAnimationFrame(animate);
	}
	animate();
</script>
</html>
